import React from "react";

import MessageBox from './MessageBox/MessageBox'
import Messages from './Messages/Messages'
import useChat from './_useChat'

const Chat = () => {
    useChat();

    return (
        <div>
            <Messages messages = {[
                 "msg 1",
                 "msg 2"
            ]} />
            <MessageBox onSendMessage={ message => {
                alert("Message Sent: " + message)
            }}/>
        </div>
    );
}

export default Chat;
